import React from "react";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import "./App.css";
import LandingPage from "./LandingPage"; // Import the LandingPage component
import CreditScoringList from "./Components/CreditScoringList";
import CreditScoringCard from "./Components/Pages/CreditScoringCard";

function App() {
  return (
    <Router>
      <div className="App">
        <Switch>
          <Route exact path="/" component={LandingPage} /> {/* Render LandingPage on the root path */}
          <Route exact path="/add-scorecard" component={CreditScoringCard} />
          {/* Other routes */}
        </Switch>
      </div>
    </Router>
  );
}

export default App;
